package day04

import util.Coord

val Forklift = '@'
val Empty = '.'

fun main() {
    val map = input.lines().map { it.toList() }

    var canLift = 0
    map.forEachIndexed { y, line ->
        line.forEachIndexed { x, c ->
            if (c == Forklift && countAdjacentForklifts(map, Coord(x, y)) < 4) {
                canLift++
            }
        }
    }
    println("Can lift $canLift rolls")
}

fun countAdjacentForklifts(map: List<List<Char>>, source: Coord): Int {
    var forklifts = 0
    source.forEachNeighbor { coord ->
        if (coord.isValid(map) && coord.get(map) == Forklift) {
            forklifts++
        }
    }
    return forklifts
}

